import React from 'react';
import Logo from "../common/Logo";
import {StyledHeader, StyledMenu} from "./styles";

function Menu() {
  const menuItems = [
    {'title': 'Home', 'href': '/'},
    {'title': 'About', 'href': '/about'},
    {'title': 'Home', 'href': '/'},
    {'title': 'Home', 'href': '/'},
    {'title': 'Home', 'href': '/'},
    {'title': 'Home', 'href': '/'},

  ];

  return (
    <StyledMenu>
      <ul>
        {menuItems.map(item => {
          <li>
            <a href={item.href}>{item.title}</a>
          </li>
        })}
      </ul>
    </StyledMenu>
  )
}

function Header() {
  return (
    <>
      <StyledHeader>
        <Logo/>
        <Menu/>
        <div>

        </div>
      </StyledHeader>
    </>
  );
}

export default Header;
